List<List<string>> puzzleList = new List<List<string>>();
puzzle.Split("\r\n").ToList().ForEach(x => puzzleList.Add(x.Split(" ").ToList()));

int safeReports = 0;
int alteredSafeReports = 0;

for (int x = 0; x < puzzleList.Count; x++)
{
    int direction = 0;
    int currentNumber = 0;
    Boolean isSafeReport = true;
    for (global::System.Int32 i = 0; i < puzzleList[x].Count; i++)
    {
        int nextNumber = int.Parse(puzzleList[x][i]);
        //Indicar primer numero de la lista
        if (currentNumber != 0)
        {
            int operation = currentNumber - nextNumber;
            if (operation > 3 || operation < -3 || operation == 0)
            {
                isSafeReport = false;
                break;
            }
            //Fijar la direccion asc or desc / 1 or -1
            if (direction == 0)
            {
                if (operation > 0)
                {
                    direction = 1;
                }
                else
                {
                    direction = -1;
                }
            }
            else if (direction == -1 && operation > 0)
            {
                isSafeReport = false;
                break;
            }
            else if (direction == 1 && operation < 0)
            {
                isSafeReport = false;
                break;

            }
        }
        currentNumber = nextNumber;

    }
    if (isSafeReport)
    {
        safeReports++;
    }
    else
    {
        //Vamos a ir probando a quitar un numero de la lista
        for (global::System.Int32 t = 0; t < puzzleList[x].Count; t++)
        {
            currentNumber = 0;
            direction = 0;
            List<string> listaAlterada = new List<string>();
            for (global::System.Int32 i = 0; i < puzzleList[x].Count; i++)
            {
                if (i != t)
                {
                    listaAlterada.Add(puzzleList[x][i]);
                }
            }
            Boolean isAlteredSafe = true;
            //Vamos a probar la lista alterada
            for (global::System.Int32 i = 0; i < listaAlterada.Count; i++)
            {
                int nextNumber = int.Parse(listaAlterada[i]);
                //Indicar primer numero de la lista
                if (currentNumber != 0)
                {
                    int operation = currentNumber - nextNumber;
                    if (operation > 3 || operation < -3 || operation == 0)
                    {
                        isAlteredSafe = false;
                        break;
                    }
                    //Fijar la direccion asc or desc / 1 or -1
                    if (direction == 0)
                    {
                        if (operation > 0)
                        {
                            direction = 1;
                        }
                        else
                        {
                            direction = -1;
                        }
                    }
                    else if (direction == -1 && operation > 0)
                    {
                        isAlteredSafe = false;
                        break;
                    }
                    else if (direction == 1 && operation < 0)
                    {
                        isAlteredSafe = false;
                        break;

                    }
                }
                currentNumber = nextNumber;

            }
            if (isAlteredSafe)
            {
                alteredSafeReports++;
                break;
            }
        }
    }
}

